window.bookSummaryJSON = "<p>Snuggle under warm blankets as you listen to the sound of coniferous tree branches creaking in the wind, while the crackle of frozen wet snow creates a humming winter nightscape.&nbsp;&nbsp;</p> <p>Unlike canned nature sounds created in a studio, renowned acoustic ecologist Gordon Hempton gives you the real deal. He travels the world recording remarkable locations that capture the essence of the place itself. His lifelong mission is to preserve nature through sound, and his soundscapes are produced with such care and quality that you feel as if he has truly brought a slice of the world into your home.&nbsp;</p> <p>This title is part of The Audible Sleep Collection, exclusive audio experiences created to invite relaxation and sleep. New and free for members.</p>"; 
